positions.forEach(function (obj, index) {

  try {
    console.log(index + 1, "of", positions.length);

    var new_appointment = get_individual(veda.ticket, obj.new_appointment);

    var new_person = getUri(new_appointment["v-s:employee"]);

    var new_position = getUri(new_appointment["v-s:occupation"]);

    var tasks_uris = query({
      ticket: veda.ticket,
      query: "'rdf:type'==='v-wf:DecisionForm' && 'v-wf:isCompleted' == 'false' && 'v-wf:to'=='" + obj.old_position + "'"
    }).result;

    var tasks = get_individuals({
      ticket: veda.ticket,
      uris: tasks_uris
    });

    tasks.forEach(function (task) {
      task["v-wf:to"] = [{type: "Uri", data: new_person}, {type: "Uri", data: new_position}];
      put_individual(veda.ticket, task);
      addRight(veda.ticket, [can_read, can_update], new_person, task["@"]);
      addRight(veda.ticket, [can_read, can_update], new_position, task["@"]);
    });
  } catch (err) {
    console.log("Error:", "deleted position", obj.old_position, err);
  }

});
